import React, { Component } from "react";
import "../Components/NavBar.css";

export class NavBar extends Component {
  render() {
    return (
      <div id="NavBar">
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </div>
    );
  }
}

export default NavBar;
